import React from "react";

function GeneralSection() {
  return (
    <div className="GeneralSection">
      <form action="">
        <label htmlFor="name">Name</label>
        <br />
        <input type="text" id="name" />
      </form>
    </div>
  );
}

export default GeneralSection;
